function form({formData},button_data)
{

   
    
    return(
        <form>
            {formData.map((data) => (
                <div key={data.key}>
                    <label>{data.label}</label>
                    <input type={data.type} name={data.name} />
                </div>
            ))}
            {button_data.map((button) => (
                <button key={button.key} type={button.type}>
                    {button.label}
                </button>
            ))}
        </form> 

    )
}
